import React from 'react';
import { useTranslation } from 'react-i18next';
import { useAuth0 } from '@auth0/auth0-react';

const Dashboard = () => {
  const { t } = useTranslation();
  const { user } = useAuth0();

  return (
    <div className="min-h-screen bg-gray-50 py-8">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="mb-8">
          <h1 className="text-3xl font-bold text-gray-900">
            {t('dashboard.welcome')}, {user?.name}!
          </h1>
          <p className="text-gray-600 mt-2">Here's your personalized career dashboard</p>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          <div className="card">
            <h3 className="text-lg font-semibold mb-4">{t('dashboard.recommendations')}</h3>
            <p className="text-gray-600">Your personalized course and career recommendations will appear here.</p>
          </div>

          <div className="card">
            <h3 className="text-lg font-semibold mb-4">{t('dashboard.timeline')}</h3>
            <p className="text-gray-600">Important upcoming deadlines and events.</p>
          </div>

          <div className="card">
            <h3 className="text-lg font-semibold mb-4">{t('dashboard.colleges')}</h3>
            <p className="text-gray-600">Government colleges near your location.</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
